function navigationState(state = initialState, action) {
  switch (action.type) {
    case SCROLL: {
      return {
        ...state,
        scroll: action.payload
      };
    }

    case TOGGLE_TOPICS: {
      return {
        ...state,
        showTopics: action.payload !== undefined ? action.payload : !state.showTopics
      };
    }

    // push to tab scene stack
    case PUSH_ROUTE: {
      const activeTabIndex = state.tabs.index;
      const activeTabKey = action.key || state.tabs.routes[activeTabIndex].key;
      const scenes = {
        ...state[activeTabKey],
        animation: action.animation,
        currentView: activeTabKey
      };

      const { route } = action;
      route.component = action.route.key;
      route.key = numbers.guid();

      const nextScenes = NavigationStateUtils.push(scenes, route);
      if (!route.id) route.id = route.title || route.key;
      const nextRoute = scenes.routes[scenes.index];
      if (route.id === nextRoute.id && route.component === nextRoute.component) {
        return state;
      }

      if (scenes !== nextScenes) {
        return {
          ...state,
          [activeTabKey]: nextScenes,
          currentView: activeTabKey
        };
      }

      return state;
    }

    // pop from tab scene stack
    case POP_ROUTE: {
      const key = action.key || state.tabs.routes[state.tabs.index].key;
      const scenes = state[key];
      const nextScenes = NavigationStateUtils.pop(scenes);

      if (scenes !== nextScenes) {
        return {
          ...state,
          [key]: nextScenes,
          currentView: key
        };
      }
      return state;
    }

    case RESET_ROUTES: {
      const key = action.key || state.tabs.routes[state.tabs.index].key;
      const prevScenes = {
        ...state[key],
        animation: 'reset'
      };
      const nextChildren = prevScenes.routes.slice(0, 1);
      const nextIndex = 0;
      const nextScenes = NavigationStateUtils.reset(prevScenes, nextChildren, nextIndex);

      return {
        ...state,
        [key]: nextScenes,
        currentView: key
      };
    }

    case REFRESH_ROUTE: {
      const key = action.key || state.tabs.routes[state.tabs.index].key;
      return {
        ...state,
        [key]: {
          ...state[key],
          refresh: new Date().getTime()
        }
      };
    }

    case RELOAD_ROUTE: {
      const key = action.key || state.tabs.routes[state.tabs.index].key;
      return {
        ...state,
        [key]: {
          ...state[key],
          reload: new Date().getTime()
        }
      };
    }

    // navigate to a new tab stack
    case CHANGE_TAB: {
      const nextTabs = NavigationStateUtils.jumpTo(state.tabs, action.key);

      // if (nextTabs !== state.tabs) {
      return {
        ...state,
        tabs: nextTabs,
        currentView: action.key
      };
      // }
      // return state;
    }

    case REPLACE_ROUTE: {
      const key = action.payload.key || state.tabs.routes[state.tabs.index].key;
      const newScene = NavigationStateUtils.replaceAtIndex(
        state[key],
        action.payload.index,
        action.payload.route
      );
      return {
        ...state,
        [key]: newScene,
        currentView: key
      };
    }

    case RELOAD_ALL_TABS: {
      return {
        ...state,
        reload: new Date().getTime()
      };
    }

    // case ACTIONS.TOGGLE_MODAL: {
    //     return {
    //         ...state,
    //         modal: {
    //             ...state.modal,
    //             isModalActive: !state.modal.isModalActive,
    //             modalKey: action.modalKey,
    //             modalViewStyle: action.modalViewStyle,
    //         }
    //     }
    // }

    default:
      return state;
  }
}

export default navigationState;
